<!DOCTYPE html>
<html>

   <body>
      <div id="app">
         <div class="pswp-gallery" id="my-gallery">

            <a href="https://www.obscuredny.com/assets/images/Nevele/Nevele6.jpg" data-pswp-width="2048" data-pswp-height="1365" target="_blank">
              <img src="https://www.obscuredny.com/assets/images/Nevele/Nevele6.jpg" width="200" height="133" alt=""/>

      <script type='module'>
         import PhotoSwipeLightbox from 'https://cdn.jsdelivr.net/npm/photoswipe@5.3.7/dist/photoswipe-lightbox.esm.js';
         const lightbox = new PhotoSwipeLightbox({
           gallery: '#my-gallery',
           children: 'a',
           pswpModule: () => import('https://cdn.jsdelivr.net/npm/photoswipe@5.3.7/dist/photoswipe.esm.js')
